Lego City City Uzay Üssü ve Roket Fırlatma Rampası 60434
8+ LEGO® City Uzay Üssü ve Roket Fırlatma Rampası (60434) uzay keşif oyuncağı, bu dünyanın dışında maceralar için özelliklerle doludur. Ana bölümün üzerinde bir kontrol odası ve 360° uzay vinci kulesi vardır, açıldığında ekipman karuseli, bilim laboratuvarı ve kafeterya alanına erişim sağlar. Sette ayrıca uzay gemisi, fırlatma rampası, inşaat aracı ve oyuncak enerji kristallerinin ve bitkilerin olduğu bir gezegen sahnesinin yanı sıra yaratıcı rol yapma faaliyetleri için 6 uzay mürettebatı minifigürü, 1 robot ve 2 uzaylı figürü bulunur. LEGO Builder uygulamasıyla çocuğunuzu heyecan verici bir yapım macerasına çıkarın. Burada modelleri inşa ederken 3 boyutlu olarak yakınlaştırabilir, döndürebilir ve her açıdan görüntüleyebilir. LEGO City uzay setleri, sınırsız yaratıcı oyunlar için gerçekçi araçlar, detaylı yapılar ve ilham verici karakterler içerir. Bu setteki roket gemisi, daha da büyük maceralar için diğer uyumlu uzay temalı LEGO oyun setlerine (ayrı satılır) bağlantı sağlayan özel bir hava kilidi parçasına sahiptir!;

Uzay keşif oyuncağı – 8 yaş ve üzeri çocuklar için LEGO® City Uzay Üssü ve Fırlatma Rampası oyun seti, uzay temalı sınırsız oyun için özelliklerle doludur;
Bu LEGO® City uzay setinde ne var? – Çocukların 360° kule vinci, uzay gemisi, fırlatma rampası, kamyon, gezegen ortamı, 6 minifigür, bir robot ve 2 uzaylı figürü olan bir oyuncak uzay üssü inşa etmeleri için gereken her şey;
Uzay gemilerini ve yaratıcı oyunları sevenler için eğlence – Çocuklar, 360° kule vinci çalıştırabilir ve üssü açarak ekipman karuseline, detaylı bilim laboratuvarına ve dinlenme alanına erişebilir;
Dijital yapım rehberi – Çocukların, modelleri inşa ederken her açıdan görebilecekleri 3 boyutlu LEGO® Builder uygulamasıyla minik uzay hayranınızı, eğlenceli bir yapım macerasına çıkarın;
Uzay severlere hediye – Bu uzay oyun setini, havalı uzay oyuncaklarını seven 8 yaş ve üzeri çocuklara vererek, sıradan bir günü özel bir güne dönüştürün;
Diğer LEGO® oyun setlerine (ayrı satılır) bağlayın – Bu setteki roket gemisi, diğer uyumlu uzay temalı setlere bağlantı için uzay hava kilidi sistemine sahiptir;
Sınırsız oyun – LEGO® City uzay oyun setleri, sınırsız yaratıcı oyunlar için gerçekçi araçlar, detaylı yapılar ve hayalle gerçeği karıştıran ilham verici karakterler içerir;
Boyutlar – Bu 1422 parçalı setteki uzay üssünün yüksekliği 33 cm, genişliği 19 cm, derinliği 29 cm’dir;

CORT, AF510-OP, KLASİK GİTAR,
Corts oldest acoustic series, the Standard Series defines superb performance and value for the money. The Standard Series guitars are affordable but offer good solid performance for beginners and hobbyists alike in a variety of models with different types of features for any playing situation. AF510 concert body acoustic features Spruce top, Mahogany back and sides, Merbau fingerboard.
&nbsp;
&nbsp;
The Concert body size is smaller and produces a more focused and balanced sound than the Dreadnaught with less emphasis on the bass and a strong midrange with clearer and sweeter highs. This sonic balance of the Concert body makes it ideal for fingerpicking as well as solo single-note playing.
SPRUCE TOP
Spruce provides an ideal balance between strength and flexibility, hence its overwhelming popularity as the wood of choice for tops of acoustic guitars. Spruces versatile sonic character makes it ideal for a variety of musical genres and playing styles.&nbsp;&nbsp;
MAHOGANY BACK &amp; SIDES
Bright yet natural with a strong and warm midrange, the beloved mahogany wood has been a standard for back and sides on premium acoustics for many decades.&nbsp;
DOVETAIL NECK JOINT
Strongly joined with meticulous workmanship by experienced craftsmen, the dovetail joint transfers the bodys vibration and resonance to the neck with no loss of energy and with plenty of detail.&nbsp;
&nbsp;
COATED STRINGS
High-quality coating on the strings resist humidity, dirt and sweat for long string life and improved playability. Specially outfitted on this model.&nbsp;
